const FooterAluno = () => {
    return (
        <footer className='text-center'>
            <style>
                {{  position : 'fixed'

                }}
            </style>
            <h1> Projeto EDUX </h1>
            <small> Desenvolvido por Grupo 8 </small>
        </footer>
    )
}

